import React from "react";
import '../styles/Button.css';

export default props => {

let classes = 'button'

classes += props.operation && 'operation' ;
classes += props.double && 'double' 
classes += props.triple && 'triple' 

return(<button
   className={classes}
    onClick={() => props.click()} >
    {props.label}
</button>)
}
